import React from 'react';
import './App.css';
import PreNavbar from './components/PreNavbar';
import Navbar from './components/Navbar';
import { BrowserRouter as Router, Route } from 'react-router-dom';


const App = () => {
  return (
    <Router>
      <Route>
        <PreNavbar />
      </Route>
      <Route>
        <Navbar />
      </Route>
    </Router>

  );
}

export default App;
